"""# TASK 4: PREPARE THE DATA BEFORE APPLYING FACEBOOK PROPHET TOOL """

avocado_df

avocado_prophet_df = avocado_df[['Date','AveragePrice']]

avocado_prophet_df

avocado_prophet_df = avocado_prophet_df.rename(columns = {'Date': 'ds', 'AveragePrice': 'y'})

avocado_prophet_df

"""# TASK 5: UNDERSTAND INTUITION BEHIND FACEBOOK PROPHET

![Screen Shot 2022-03-02 at 12.53.04 PM.png](data:image/png;base64,)

![Screen Shot 2022-03-02 at 12.53.10 PM.png](data:image/png;base64,)

![Screen Shot 2022-03-02 at 12.53.18 PM.png](data:image/png;base64,)

# TASK 6: DEVELOP MODEL AND MAKE PREDICTIONS - PART A
"""

m = Prophet()
m.fit(avocado_prophet_df)

# Forcasting into the future
future = m.make_future_dataframe(periods = 365)
forecast = m.predict(future)

forecast

figure = m.plot(forecast, xlabel = 'Date', ylabel = 'Price ')

figure2 = m.plot_components(forecast)

"""# TASK 7: DEVELOP MODEL AND MAKE PREDICTIONS (REGION SPECIFIC) - PART B"""

# dataframes creation for both training and testing datasets 
avocado_df = pd.read_csv('avocado.csv')

# Select specific region
avocado_df_sample = avocado_df[avocado_df['region']=='West']

avocado_df_sample = avocado_df_sample.sort_values('Date')

plt.plot(avocado_df_sample['Date'],avocado_df_sample['AveragePrice'])

avocado_df_sample = avocado_df_sample.rename(columns = {'Date':'ds','AveragePrice':'y'})

m = Prophet()
m.fit(avocado_df_sample)
# Forcasting into the future
future = m.make_future_dataframe(periods=365)
forecast = m.predict(future)

figure = m.plot(forecast, xlabel='Date', ylabel='Price')

